import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";
import App from "./App";
import ImageView from "./ImageView/ImageView";

const Router = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route />
      </Switch>
    </BrowserRouter>
  );
};
export default Router;
